import React from "react";
import "./ShoppingPageMenu.css";



const ShoppingPageMenu = () => {
  return (
    <section class="shopping">
    <div class="text-box">
        <h2>Female</h2>
        <div>
          <p>• Shirts</p>
          <p>• Jeans</p>
          <p>• Hoodies</p>
          <p>• Under Wear</p>
          <p>• Shoe Wear</p>
          <p>• Swim Wear</p>
        </div>
        <h2>Male</h2>
        <div>
          <p>• Shirts</p>
          <p>• Jeans</p>
          <p>• Hoodies</p>
          <p>• Under Wear</p>
          <p>• Shoe Wear</p>
          <p>• Swim Wear</p>
        </div>
      </div>
      </section>
  );
};

export default ShoppingPageMenu;
